%spark
def sentiment(s:String) : String = {
    val positive = Array("praise","development","good","awesome","our","ache din","governance","success","lighted","manufacture",
    "management","praiseworthy","best","vote for modi","help","terrorist attack","support","again","win","pass","famous","hero","system","gas connection",
    "black money","gdp growth","ujjwalla","foreign affairs","hail");
    val negative = Array("fails", "chowkidar chor hai", "scam","chor","cheat","bad","worst","loss","criminal","culprit","illiterate","terrible",
    "corruption","failure","riot","beef","communal","villain","hell","no","not anymore","issue","no jobs")

    var st = 0;

    val words = s.split(" ")    
    positive.foreach(p =>
        words.foreach(w =>
            if(p==w) st = st+1
        )
    )

    negative.foreach(p=>
        words.foreach(w=>
            if(p==w) st = st-1
        )
    )
    if(st>0)
        "positivie"
    else if(st<0)
        "negative"
    else
        "neutral"
}

spark.udf.register("sentiment", sentiment _)
